INSERT INTO tbladdictions VALUES("5","I am addicted to (Specify the things your addicted to in the box given)           (Explain)","","","","","","","","","","","1","2011-12-01 15:33:10");
INSERT INTO tbladdictions VALUES("14","I am motivated by other persons to quit","Facing financial problem, temperory relief","","No one to guide, distured mind thus cant take a right decision","","Motivated, stable, tolerant","","Awareness of the effects of addiction, fear one may fall sick if not controlled, fear of financial loss due to addiction","","Good work environment/ colleagues, family support","","1","2011-12-03 08:12:17");
INSERT INTO tbladdictions VALUES("6","I became addicted due to (Reason Box)","","","","","","","","","","","1","2011-12-02 05:32:57");
INSERT INTO tbladdictions VALUES("7","Intensity of my addiction (rating yourself how much you are depended on it)","Avoids others company, belives in self,strong positive attitude, enjoys life, faces the problems boldly","","Control over negative thoughts, active, does not want to fall a prey","","Balanced, stable, relaxed","","To divert negative thoughts, time pass led to addiction, failure, issues at job, family etc. terminal illness, bad company","","Disturbed negative thoughts, uncontrollable, withdrawl symptoms, gives peace of mind, temporary relief","","1","2011-12-02 05:34:24");
INSERT INTO tbladdictions VALUES("8","I made a firm mind to quit as I Visualized the bad  effects of the addiction in future if  i donâ€™t quit  Today","Habituated, not bothered about the effects on health and others","","Not stable, not able to control negative emotions/ addictive behaviour","","Can control negative emotions, plans things, gets the work done on time/ hardworking, sincere","","Distance from close friends, shame, guilty, affect on family/job","","Motivated to quit, feedback regarding the effects, finance/ family is affected, deterioration of health","","1","2011-12-02 05:36:08");
INSERT INTO tbladdictions VALUES("9","I  could overcome temptation today","Habituated, not even able to make an attempt, family problems, not co-operative, loneliness, depressed","","Not stable, confused whether to quit or no, no proper positive motivation, health problems, financial problems","","Stable, balanced, manages negative emotions","","Positive approach towards life and situations, will power, happy with family","","Wants to be free from addiction,manages finances well, dedicated towards work, handles responsibility, aware of the disadvantages of addiction","","1","2011-12-02 05:38:31");
INSERT INTO tbladdictions VALUES("12","I Started using different ways to express my stress/problem leaving harmful addictions","Accepted addiction as a passion, stress reliever, time pass","","Too much addicted, dependent,tries to make an attempt but suffers from withdrawal symptoms which is not controllable","","Calm, relaxed, balanced","","Happy after taking a positive step, feels good, has become more responsible, enjoys work on hand, watches good movies, practices relaxation","","Firm in the decision made, thinks positive, has diverted ones mind in value based activity, express stress in a appropriate way, spends more time with family","","1","2011-12-03 08:07:51");
INSERT INTO tbladdictions VALUES("13","Any withdrawal symptoms & its intensity","Job satisfaction, happily married, enjoys life","","Divergent thinking, family support","","Motivated, stable, handles the problems tactfully","","Financial problem, no proper guiding, negative incident","","Too much addicted, uncontrollable, need extra care/ medical, counselling","","1","2011-12-03 08:09:58");
INSERT INTO tbladdictions VALUES("10","I diverted my mind  & overcame my Temptation at least once today","Not able to overcome, tired of life, depressed, lack of interest","","No proper positive motivation,financial problems, family problems, problems at job","","Balanced, happy, relaxed","","Has a positive attitude towards self and others, wants to overcome addiction for ones good as well as others","","","Wants to enjoy life with family & friends, wants to have a secure future hence forth","1","2011-12-02 05:39:30");
INSERT INTO tbladdictions VALUES("11","I started reducing the number of quantity of the substance used","Unexpressive, does not want to change, financial problem, tension","","Not able to control negative thoughts, confused state, bad situation","","Stable, controllable, tolerant","","Increased will power to control, realised the effects of addiction on the whole","","Trying to manage and overcome, controlling negative thoughts, channalyzing the energy into something productive","","1","2011-12-03 08:07:16");
INSERT INTO tbladdictions VALUES("15","I feel over all better while reducing or quiting my addictive habit, thus making a positive change in me","Undergoing major shock do incident in family, friends, job etc, trying to divert mind, gets temporary relief","","Trying but not able to succeed, no proper guidance, fear of future","","Stable mind, good attention and concentration","","Awareness of the effects of addiction,wants to be healthy and keep self and others happy","","Controlling negative thoughts to a large extent, confident, will-power","","1","2011-12-03 08:13:54");
