INSERT INTO tblgeneralstressors VALUES("3","Today, I  feel that my Life is really out of control.","Takes up challenges positively, leadership quality, rational thinking","Normal thus treatment not indicated","Control over thoughts, very much relaxed and comfortable, patient","Normal thus treatment not indicated","Simple living, flexible, compromising","Normal thus treatment not indicated","Unstable, restlessness, over reactive","Firstly, practice deep breathing & relaxation. Share your feelings with the trusted ones, this helps to let out the bottled up emotions. Think positive nothing is impossible. Accept the job in hand and accept the responsibilities willingly and smilingly you will  benefit","Inability to control negative thoughts, exhaustion, feelings of nervous tension","Practice deep breathing, try to stop the negative thought by replacing it with the positive thought.Try to divert your mind to something that is interesting and makes you happy.","1","2011-11-29 11:46:25");
INSERT INTO tblgeneralstressors VALUES("5","Today, I experienced physical symptoms when stressed.","Sound physical and mental health, strong will-power.","Normal thus treatment not indicated","Patient, very much relaxed and comfortable, control over thoughts.","Normal thus treatment not indicated","Flexible, balanced, tolerant, adjusting.","Normal thus treatment not indicated","Insomnia, projection, overburdened.","Needs to take proper care of health and do not neglect any kind of mild sickness. It is better to take precaution before it becomes chronic. Sharing your feelings with someone you trust. reading books on how stress can affect. Practicing deep breathing , exercise & relaxation.","Flushed face, palpitation, breathlessness.","Avoiding negative thoughts by replacing it with the correct opposite positive thought, practicing tension releasing exercises","1","2011-11-30 04:59:34");
INSERT INTO tblgeneralstressors VALUES("6","Today, when under pressure/stress, my  mental/ emotional life  & my overall health was affected.","Clarity in thinking, hardworking, takes up challenges positively, sound physical and mental health, high self-esteem.","Normal thus treatment not indicated","Quick decision making ability, very much relaxed and comfortable, high job satisfaction.","Normal thus treatment not indicated","Balanced, compromising, patient,  Self- knowledge, self-realization.","Normal thus treatment not indicated","Blaming others, impatient  low self- esteem.","Needs to practice deep breathing exercise & relaxation, read good books, watch good entertaining t.v. channel. Try to be patient, Do not neglect any mild sickness before they become chronic","Inability to control negative thoughts, anxious, lacks attention and concentration, fear, depressed, sad.","Have faith in God. Prioritize the work. Practice relaxation twice daily.","1","2011-11-30 04:59:59");
INSERT INTO tblgeneralstressors VALUES("7","Today, I could not  tolerate delays, as in queues/traffic jams.","Rational thinking, takes up challenges positively.","Normal thus treatment not indicated","Patient, maintains good relationship,  quick decision making ability.","Normal thus treatment not indicated","Adjusting, tolerant, compromising.","Normal thus treatment not indicated","Impatient, self-blaming.","Relax, practice deep breathing, try accepting reality,listen to some nice music, learn to convince the boss when there is a genuine problem by making him understand the cause for your delay.","Exhaustion, anxious, trembling, lacks attention and concentration.","Needs to practice Meditation in order to improve attention, concentration, memory, etc. Practice few exercises in the morning or evening. Go for walks or jogging.","1","2011-11-30 05:00:17");
INSERT INTO tblgeneralstressors VALUES("8","Today, I could not  relax and enjoy moments of pleasure.","Very much relaxed and comfortable, takes up challenges positively.","Normal thus treatment not indicated","Clarity in thinking, patient, control over thoughts.","Normal thus treatment not indicated","Flexible, tolerant,  compromising.","Normal thus treatment not indicated","Blaming others,  self- blaming, displacement, uncomfortable.","Stop worrying about past or future, live in present and enjoy it as present is the gift of God. Relax, practice deep breathing exercises,be aware of the negative effects of stress.","Feelings of nervous tension, inability to control thoughts, insomnia, impatient.","Accept responsibility with the smile, schedule your work on priority basis, procrastination of work leads to all the problems. Sleep at the right time and do not take worries to bed.","1","2011-11-30 05:00:37");
INSERT INTO tblgeneralstressors VALUES("9","Today, it was hard to maintain good relationships with others, even (or especially) those closest to me.","Maintains good relationship, quick decision making ability.","Normal thus treatment not indicated","Patient, very much relaxed and comfortable.","Normal thus treatment not indicated","Adjusting, flexible, tolerant.","Normal thus treatment not indicated","Over reactive, lacks attention and concentration, lacks planning.","Relax and reflect on your attitude and just put yourself on the other-side and think. You will automatically understand where you have gone wrong. It is better to remember that it is very difficult to gain and win over a relationship but it is very easy to loose it. Try being more patient & calm.Practice relaxation or meditation to implement this.","Anxiousness, unstable, regression.","Enjoy the company of family and friends, involve yourself in some or the other activity which interests you","1","2011-11-30 05:01:01");
INSERT INTO tblgeneralstressors VALUES("10","Today, I was not patient when someone was doing something slower than I could do it.","Rational thinking, leadership quality, strong will-power.","Normal thus treatment not indicated","Patient, quick decision making ability, maintains good relationship.","Normal thus treatment not indicated","Balanced, flexible, tolerant, adjusting.","Normal thus treatment not indicated","Blaming others, impatient.","Need to be more realistic, accept life as it comes, nobody is genius. Practice yoga or meditation. Involve self in some activity which you enjoy","Feelings of nervous tension, exhaustion, restlessness.","Take proper rest and go to bed on time. Practice exercises or go for walk or jogging. Have a proper work schedule","1","2011-11-30 05:01:34");
INSERT INTO tblgeneralstressors VALUES("11","Today, I did take work home for weekends/on holidays.","Takes up challenges positively, rational thinking, strong will-power, leadership quality.","Normal thus treatment not indicated","Quick decision making ability, control over thoughts, hardworking.","Normal thus treatment not indicated","Decision making  ability, compromising, flexible, adjusting.","Normal thus treatment not indicated","Deadlines, lack of planning,  self-blaming.","Need to practice deep breathing, relaxation or meditation or Yoga. Accept the responsibility with the smile. Plan your work in such a way that nothing remains pending","Exhaustion, restlessness, insomnia, overburdened.","Accept the job in hand and be satisfied and work for the betterment of the firm, you will be pleased even though you are rewarded or not. As honesty is the best policy.Finishing the work in right time will help you in spending time fruitfully in weekends with your family.","1","2011-11-30 05:01:56");
INSERT INTO tblgeneralstressors VALUES("12","Today, when under Stress, I did resort to any Addictions.","Sound physical and mental health, strong will power, leadership quality.","Normal thus treatment not indicated","Compromising, patient, very much relaxed and comfortable.","Normal thus treatment not indicated","Balanced, patient, adjusting, decision making ability.","Normal thus treatment not indicated","Displacement, impatient, fear to take risk .","Need to practice yoga or meditation or any kind of relaxation technique. Try keeping yourself busy in some activity or concentrate on your hobby. Plan your work, plan your weekends.","Over burdened, dead lines, unstable, trembling.","Learn the negative effects of addiction, so its better to avoid it.Accept responsibility you will notice that you can fulfill it because its only your approach that matters","1","2011-11-30 05:02:18");
INSERT INTO tblgeneralstressors VALUES("13","Today, I was not able to express my anger appropriately to resolve issues, hence allowing it to create problems for others and myself.","Ability to remember things, cheerful, approachable, good sense of humor.","Normal thus treatment not indicated","Judgmental, empathetic, problem solving ability.","Normal thus treatment not indicated","Stable, self-knowledge, good planning ability.","Normal thus treatment not indicated","Dependent, fed up, low self-esteem, aggressive.","Need to practice deep breathing, yoga or meditation. Remember the fact that nobody is perfect, mistakes do happen, so it is better to be more patient to maintain good relationships, involve yourself in some activity that you enjoy","Dejection, sad, uncomfortable, gets angry easily.","Practice anger management techniques, such as counting numbers, watch yourself in the mirror, try to laugh at yourself, be relaxed","1","2011-11-30 05:02:30");
INSERT INTO tblgeneralstressors VALUES("14","Today, due to my problems I was emotionally disturbed and found it very difficult to reach out to any conclusions","","","","","","","","","","","1","2012-05-08 08:59:55");
