INSERT INTO tblmajorlifeevents VALUES("3","Today , I did experience positive events.","Depression, death of loved ones, change in job, home.","Practice deep breathing, practice thought stopping i.e replacing the negative thought with the positive thought. Accept life as it comes.Enjoy the company of family and friends","Major/minor accident, demotion, insecurity.","Accept responsibility, do not overburden yourself, do not procrastinate,learn from your experience and do not repeat the same mistake.","Loving, balanced, trust in others.","Normal thus treatment not indicated","Awareness of strengths and weakness, problem solving ability.","Normal thus treatment not indicated","Accepting life as it is, easily adjustable to new situation, divergent thinking.","Normal thus treatment not indicated","1","2011-12-01 15:07:11");
INSERT INTO tblmajorlifeevents VALUES("4","Today , I did experience negative events.","Accepting life as it is, divergent thinking, easily adjustable to new situation.","Normal thus treatment not indicated","Promotion, ability  to control  negative emotions.","Normal thus treatment not indicated","Approachable, ability  to control negative emotions.","Normal thus treatment not indicated","Change in job, home, demotion, poor time management, feelings of insecurity.","Life is not a bed of roses, so take it as it comes, see that you do not commit the same mistakes as before. Relax and manage things. Learn to be strong and balanced.","Death of loved ones, love failure, single parenting.","Practice relaxation and deep breathing,develop positive attitude towards self and others.","1","2011-12-01 15:38:28");
