INSERT INTO tblmycommunications VALUES("5","Today, I expressed my emotions /conveyed my thoughts in proper ways, without hesitation or pre- judging others.","Unable to express his opinion freely, hesitation, distortion of thoughts. Emotionally disturbed, anxious.","Learn to be a good listener, better to be more assertive, join a laughter club or practice laugh therapy and smile therapy","Shy, lack of focus, fear, Low self-esteem, lack of trust/ confidence, difficulty in communication and expression.","Practice auto-suggestion it can help you to be confident and also to face the crowd. Practice deep breathing exercises","Balanced, communicative, creative, self-realization.","Normal thus treatment not indicated","Clarity in thinking and reasoning, gentle, judgmental, high self- esteem.","Normal thus treatment not indicated","Fluent, focused, originality, bold, positive, high job satisfaction.","Normal thus treatment not indicated","1","2011-11-29 13:26:42");
INSERT INTO tblmycommunications VALUES("6","Today, I acknowledged and apologized for mistakes/ oversights I made.","Feelings of being left out, hesitation inhibited thoughts, fear.","Learn to be practical and honest. Accept your mistakes try to rectify it and see that you do not repeat it.","Involved in past thoughts and situations, problem in adjusting.","Concentrate on the work you do otherwise you will end up doing still more mistakes. Involvement in past thoughts will not gain you anything. Life is full of adjustments so if you take a first step to do so others will automatically work in hand with you","Balanced, communicative, gentle, forgiving.","Normal thus treatment not indicated","Intelligent, bold, able to express my thoughts and emotions.","Normal thus treatment not indicated","Good facial expressions and gesture, expressive, outgoing.","Normal thus treatment not indicated","1","2011-11-30 05:06:26");
INSERT INTO tblmycommunications VALUES("7","Today, I gave due respect to peopleâ€™s different social or cultural communication styles, differing sensitivity to and styles of, expressing their feelings.","Frustrated, unable to express his opinion freely, fear, lack of trust.","Be assertive, learn to respect others, be expressive. Accept your responsibility with the smile. Share your feelings with one whom you trust","Lacks creativity, problem in adjusting, egoistic, introvert.","Involve yourself in social gathering, accept others views and opinions and try sharing yours. Practice smile & laugh therapy","Focused, fluent, patient, balanced, empathetic.","Normal thus treatment not indicated","Handles life constructively and creatively, clarity in thinking and reasoning, forgiving.","Normal thus treatment not indicated","Outgoing, expressive, positive, bold, good sense of humor, judgmental.","Normal thus treatment not indicated","1","2011-11-30 05:07:10");
INSERT INTO tblmycommunications VALUES("8","Today, I listened to others patiently when they were saying something.","Egoistic, gets tensed and exhausted and then over reacts.","Practice deep breathing & auto-suggestion, be flexible in accepting or reviewing others opinion because you may be befitted out of it. Be a good listener","Impatient, frustrated, shy.","Practice smile and laugh therapy. Accept your job and responsibilities with the smile.","Balanced , patient, gentle.","Normal thus treatment not indicated","Creative, intelligent, focused.","Normal thus treatment not indicated","Originality, divergent thinking, expressive.","Normal thus treatment not indicated","1","2011-11-30 05:07:45");
INSERT INTO tblmycommunications VALUES("9","Today, I enjoyed receiving compliments, appreciation, and recognition from others.","Feelings of being left out, involved in past thoughts and situations.","Sharing ones feelings with someone you trust, living in the present and enjoying the present. Practicing some relaxation techniques.accepting responsibility with the smile","Impatient, lacks recognition.","Being calm and understanding the matter before coming into any conclusions. Try to be assertive, replace your negative thoughts to positive through thought stop technique. Remember when thoughts change the behaviour automatically changes","Creative, intelligent, communicative, gentle.","Normal, hence treatment not indicated","Clarity in thinking and reasoning, good facial expression and gesture, bold.","Normal, hence treatment not indicated","Forgiving,  positive, ability to express thoughts and emotions, positive.","Normal, hence treatment not indicated","1","2011-11-30 05:08:10");
INSERT INTO tblmycommunications VALUES("10","Today, before offering help, I found out if it is really wanted or beneficial (except emergencies).","Frustrated, hesitation.","Keep in mind service to mankind is service to God. Treat everyone equal. if you are humble and charity oriented gods blessings are always there with you.","Impatient, involved in past thoughts and situation.","Live in present and enjoy the present, present is the gift of god so enjoy. There is no worrying about the past as we do not gain anything but rather loose","Patient,  creative, bold, reliable.","Normal, hence treatment not indicated","Focused, intelligent, empathetic.","Normal, hence treatment not indicated","Positive, expressive, out going, forgiving.","Normal, hence treatment not indicated","1","2011-11-30 05:08:35");
INSERT INTO tblmycommunications VALUES("11","Today, I was able to say â€œnoâ€ to people without feeling guilty/feeling bad.","Feelings of guilt, depression.","Try to be positive and realistic in life. Take up the challenges and opportunities. Be assertive","Lack of job satisfaction, gets angry easily.","Be more patient, enjoy the job in hand and accept the responsibilities with a smile.","Empathetic, self-realization, stable.","Normal, hence treatment not indicated","Problem solving ability, approachable.","Normal, hence treatment not indicated","High self-esteem, high job-satisfaction, good sense of humor.","Normal, hence treatment not indicated","1","2011-11-30 05:09:46");
INSERT INTO tblmycommunications VALUES("12","Today, I  was able to easily adjust to the immediate environment by being attentive to the task on hand.","","","","","","","","","","","1","2012-05-08 09:02:38");
INSERT INTO tblmyrelations VALUES("1","Today, I was able to easily pay attention, focus and concentrate by controlling  of recurring or unwanted thoughts","Lacks responsibility, feelings of loneliness, lacks attention and concentration, negative experience, pre-occupied with negative thoughts.","Develop faith in God. Practice deep breathing and relaxation. Engage yourself in activities you enjoy and spend your free time fruitfully.","Lacks faith in relationship, unable to plan things,  irritable,  forgetfulness, egoistic, impatient.","Accept life as it is, live in the present and enjoy the present. Plan out your things properly. Practice Meditation","Lives in present, god fearing, good attention and concentration, judgmental.","Normal thus treatment not indicated","Sportive, focused, happily married, relaxed,  ambitious, patient.","Normal thus treatment not indicated","Responsible, control over negative emotions, positive attitude towards life.","Normal thus treatment not indicated","1","2011-12-01 14:41:53");
INSERT INTO tblmyrelations VALUES("3","Today, I was able to focus my awareness in the present moment, instead of living in the past and look forward to future as an opportunity for further growth.","Worried about past or future, not happily married, problems in adjusting, sense of guilt.","Accept life as it is. Be a faithful partner/ employee. Plan out your things prior, live in present as it is a gift of god","Unable to plan things, financial problems, poor time management.","Schedule your work. Prioritize them, spend tactfully not lavishly, as this will help you in saving","Self-awareness, lives in present, good attention and concentration.","Normal thus treatment not indicated","Focused, manages finances well, happily married.","Normal thus treatment not indicated","Good listener, problem solving ability, control over negative emotions.","Normal thus treatment not indicated","1","2011-12-02 05:03:38");
INSERT INTO tblmyrelations VALUES("4","Today, I was able to get 6-8 hours of high quality sleep per night","Lacks sleep or disturbed sleep, single parenting, marital distortion","Prioritize your work, see that you sleep at least for  six to seven hours. Do not bottle up your feelings rather share them with someone very dear to you. Have faith in God. Think positive","Unable to plan things, problem in adjusting, financial problems","Prioritize your things, have faith in God, be positive. Have control over your expenditure. Love everyone in turn you will receive the same","Lacks sleep disturbances/ gets sound sleep, lives in present, god fearing","Normal thus treatment not indicated","Focused, manages finances well, problem solving ability","Normal thus treatment not indicated","Happily married, responsible, relaxed","Normal thus treatment not indicated","1","2011-12-02 05:04:28");
INSERT INTO tblmyrelations VALUES("5","Today, I was able to  distinguish between accepting responsibility for a problem and blaming myself for it","Lacks responsibility, over compromising, feelings of loneliness, does not forgive easily.","Be truthfully as that will give you long run happiness, engage your self in something interesting whenever you are free, learn to forgive and forget you will automatically experience happiness.","Worried about past or future, lacks attention and concentration, unable to plan things.","Live in present and enjoy the present, Concentrate on whatever you do for this practice deep breathing and meditation daily. Prioritize things and implement on them, your planning skills will automatically improve","Lives in present, self-awareness, good attention and concentration, maintains harmony","Normal thus treatment not indicated","Focused, good problem solving ability, control over negative emotions.","Normal thus treatment not indicated","Service minded, good listener, responsible, sportive.","Normal thus treatment not indicated","1","2011-12-02 05:05:42");
