INSERT INTO tblpages VALUES("17","Wellness Concept Design - Residential Wellness Clubs Diagram","A  HARBINGER of Good Health, Joy & Happiness for your Townships & Complexes.","<p>Increasing lifestyle based problems, stressful work environments, and rising junk food intakes have spurred a number of health related problems: obesity, increasing cholesterol levels, deteriorating heart conditions et al. With an increasing number of lifestyle related diseases there is realization that &ldquo;<strong>prevention is better than cure</strong>&rdquo;.<br /> <br /> Be it health based foods, exercising or living a right lifestyle, consumers want to have personalized Wellness packages &amp; also track the benefits.<br /> <br /> <strong>Due to their hectic daily or weekly routine, people need ready access to quality Wellness Programs to maintain their all-round health &amp; productivity.</strong><br /> <br /> Wouldn&rsquo;t it be a <strong>great VALUE PROPOSITION</strong>, if you could provide this accessibility factor at the doorstep of the Members of your Complexes &amp; Townships by setting up unique WELLNESS CENTRES with great Value in terms of Health as well as Money.<br /> <br /> For your evaluation, please find attached herewith :<br /> <strong>1.</strong> Wellness Centre Cost Benefit Chart  (Summary) for 200, 300 &amp; 750 Apartments.<br /> <strong>2.</strong> Wellness Centre &ndash; Setup &amp; Maintenance Costs for 200 &amp; 300 Apartments.<br /> <strong>3.</strong> Wellness Centre &ndash; Setup &amp; Maintenance Costs for 750 Apartments. <br /> <strong>4.</strong> Therapy Value Analysis for Complexes with 200 &amp; 300 Apartments.<br /> <br /> Please let us know, if you have any further queries. Look forward to meeting you personally for a detailed Presentation &amp; Financials.</p>","Chaitanya Wellness Research Institute - Wellness Concept Design - Residential Wellness Clubs Diagram","Chaitanya Wellness Research Institute","Chaitanya Wellness Research Institute","0","0