lay in seeking it because of something you have read on this Site.&nbsp;<span style=\\\"text-align: justify;\\\">The website may contain images from other website, every effort has been made to give credit to the website from where the images are taken along with the name of the image creator by writing their name adjacent to the image where it is used, however failure or omission by Chaitanya Wellness to give credit to the image creator or the website from where the images are taken is purely unintentional and without any malafide or dishonest intent. The images used on this website are subject to copyright and trademark laws, publicity and privacy laws, moral rights, and applicable regulations and statutes as stated in their respective websites. Chaitanya Wellness makes no representation of ownership of copyright in these images. You should not remove any copyright or other proprietary rights notice contained in the represented Images or any related promotional materials provided on this Website.</span>If you have any questions, email to query-disclaimer@wellnessway4u.com.</p>","Chaitanya Wellness Research Institute - Disclaimer","Chaitanya Wellness Research Institute, wellnessway4u","Chaitanya Wellness Research Institute, wellnessway4u, Preventive Healthcare, Personalised Health & Wellness Management, Emotional & Stress Management, Holistic Health, Rejuvenation, Provide Support Tools to complement the expertise of Health & Wellness Practitioners, tracking and Self Awareness wellness guide","1","0","2011-12-05 04:44:25","1","0","0","0","0","Disclaimer","disclaimer.php");
INSERT INTO tblpages VALUES("29","Privacy Policy","Privacy Policy","<p>The pages of the website of Chaitanya Wellness Research Institute (\\\"the Web Site\\\") contains proprietary notices and copyright information, the terms of which must be observed and followed by the users of the Web Site. 1.	Introduction:  We, Chaitanya Wellness Research Institute (\\\"Chaitanya Wellness\\\") are committed to respecting your privacy and recognize your need for appropriate protection and management of any Personal Information you share with us. Personal Information is information about you that is personally identifiable like your name, age, sex, address, email address, or phone number, and that is not otherwise publicly available.  By using this Web site, you consent to the terms of our Privacy Policy and to Chaitanya Wellness\\\'s processing your Personal Information. You allow Chaitanya Wellness to use the information posted by you &amp; results /reports generated thereof for research purposes in individually unidentifiable format. We are sensitive to privacy issues and have established this Policy so that you can understand the care with which we intend to treat your Personal Information.  2.	Coverage:  Personal Information means any information that may be used to identify an individual, including, but not limited to, a first and last name, a home or other physical address and an email address or other contact information, whether at work or at home. The personal information collected on this site is used for the purpose for which it is requested. This Policy covers how Chaitanya Wellness treats Personal Information that it collects and receives.  This Policy does not apply to the practices of companies / advertisers that Chaitanya Wellness does not own or control or to people that Chaitanya Wellness does not employ or manage. If you choose to provide Chaitanya Wellness with your Personal Information, Chaitanya Wellness may transfer that Personal Information within Chaitanya Wellness group or to its third-party service providers, across borders, and from your country or jurisdiction to other countries or jurisdictions around the world.  This Policy does not apply to any information which you have disclosed publicly or to information for which you have consented that this Policy does not apply or to information which is required to disclosed in public interest or to information which is required to be disclosed pursuant to valid court orders or regulatory orders. 3.	Information Collection and Use  Chaitanya Wellness collects personal information when you register as a member with Chaitanya Wellness, when you use Chaitanya Wellness services, when you visit Chaitanya Wellness pages or the pages of certain Chaitanya Wellness partners/advertisers. Chaitanya Wellness may combine information about you that Chaitanya Wellness has with information that Chaitanya Wellness obtains from its business partners or other companies.  When you register with Chaitanya Wellness, Chaitanya Wellness will ask for information such as your name, email address, birth date, gender, pin code, occupation, industry, and personal interests etc. For some products and services Chaitanya Wellness may also ask for your address, and information about your assets. Once you register with Chaitanya Wellness and sign in to Chaitanya Wellness services, you are not anonymous to Chaitanya Wellness.  Chaitanya Wellness uses information for the following general purposes: to customize the advertising and content you see, fulfill your requests for products and services, improve our services, contact you, conduct research, and provide anonymous reporting for internal and external clients.  Chaitanya Wellness collects resumes from job applicants and the same are used to evaluate the candidate. The information contained in resumes are not used for any other purpose and are not shared with any entity unrelated to Chaitanya Wellness. Resumes of individuals / applicants not hired are disposed of when they are either no longer under consideration or are considered outdated.  Contact information for potential clients or persons seeking business information is collected in order for us to contact them to provide them with information about our products and services. This information will be stored on our servers in India. Such information is usually deleted depending on storage requirement or in the normal course of business, but can be amended or deleted upon request.  4.	Children\\\'s Privacy Chaitanya Wellness is not structured to attract minors. Accordingly, it does not intend to collect Personal Information from anyone under 18 years of age., except for an exclusive Students Module proposed to be introduced in due course of Time. 5.	Information Sharing and Disclosure Chaitanya Wellness does not rent, sell, or share Personal Information about you with other people or nonaffiliated companies except for research purposes or to provide products or services you\\\'ve requested, when Chaitanya Wellness has your permission, or under the following circumstances:  ï¿½	Chaitanya Wellness provides the information to trusted partners who work on behalf of or with Chaitanya Wellness under confidentiality agreements. These companies may use your Personal Information to help Chaitanya Wellness communicate with you about offers from Chaitanya Wellness. However, these companies do not have any independent right to share this information.  ï¿½	Chaitanya Wellness does not intend to transfer Personal Information without your consent to third parties who are not bound to act on Chaitanya Wellness\\\'s behalf unless such transfer is legally required in response to court orders, warrants, legal process, or to establish or exercise its (Chaitanya Wellness) legal rights or defend against legal claims etc. ï¿½	Chaitanya Wellness believes it is necessary to share Personal Information in order to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of Chaitanya Wellness\\\'s terms of use, or as otherwise required by law.  ï¿½	Chaitanya Wellness transfers information about you if Chaitanya Wellness is acquired by or merged with another company. In such an event, you shall be governed by such companies\\\' privacy policy. 6.	Other Information  ï¿½	We reserve the right to send you certain communications relating to the Chaitanya Wellness service and products, such as service announcements, administrative messages, that are considered part of your Chaitanya Wellness account, with offering you the opportunity to opt-out of receiving them.  ï¿½	In case you wish to delete your Chaitanya Wellness account, kindly email us at delete-mypwt@wellnessway4u.com. However, certain information may still remain in the archived records of Chaitanya Wellness. These are necessarily backup copies of the information, which Chaitanya Wellness takes as a routine course. 7.	Confidentiality  ï¿½	Chaitanya Wellness has implemented reasonable security measures in order to protect both personal and non-personal information from loss, misuse and unauthorized access, disclosure, alteration or destruction.  ï¿½	Chaitanya Wellness has safeguards that protect Personal Information about you.  ï¿½	Chaitanya Wellness\\\'s Web site may contain links to other sites such as Chaitanya Wellness partners and affiliates/ advertisers. While we try to link only to sites that share our high standards and respect for privacy, we are not responsible for the content or the privacy practices employed by other sites.  8.	AntiSpam policy  Chaitanya Wellness recognizes the receipt, transmission or distribution of spam emails (unsolicited bulk emails) as a major concern and has taken reasonable measures, to minimize the transmission and effect of spam emails in its computing environment. All emails received by Chaitanya Wellness, are subject to spam check. Any email identified as spam will be rejected with sufficient information to the sender for taking necessary action. With this measure, along with other technical spam reduction measures, Chaitanya Wellness hopes to minimize the effect of spam emails. Chaitanya Wellness reserves the right to reject and/or report any suspicious spam emails, to the authorities concerned, for necessary action, from time to time.  9.	Consent to transfer:  This Web Site is operated in India. If you are located outside India, please be aware that any information you provide to us will be transferred to India. By using our Web Site, participating in any of our services and/or providing us with your information, you consent to this transfer. 10.	Changes:  Chaitanya Wellness may update this policy from time to time. Chaitanya Wellness may notify you about significant changes by sending a notice to the primary email address specified in your account or by placing a prominent notice on this Web-site for a reasonable period of time. You are required to periodically check this website to know the changes.</p>","Chaitanya Wellness Research Institute - Privacy Policy","Chaitanya Wellness Research Institute, wellnessway4u, Preventive Healthcare, Personalised Health & Wellness Management, Emotional & Stress Management, Holistic Health, Rejuvenation, Provide Support Tools to complement the expertise of Health & Wellness Practitioners, tracking and Self Awareness Wellness management Tool,","Chaitanya Wellness Research Institute, wellnessway4u, Preventive Healthcare, Personalised Health & Wellness Management, Emotional & Stress Management, Holistic Health, Rejuvenation, Provide Support Tools to complement the expertise of Health & Wellness Practitioners, tracking and Self Awareness Wellness management Tool,","1","0","2011-12-05 04:47:03","1","0","0","0","0","Privacy Policy","privacy_policy.php");
