INSERT INTO tblsleeps VALUES("15","I have bad dreams","Shares the problems with someone close, optimistic","Normal thus treatment not indicated","Goes to bed on time, prays to god, happy and satisfied","Normal thus treatment not indicated","Balanced, relaxed","Normal thus treatment not indicated","Watched a frightening movie, worried about future or next days work, occurance of major failure","Remember success and failure are part and parcel of life. Accept life as it comes. Be more focused towards your work. Do not watch movies which you feel are frightening. Sort out things peacefully","Fear, anxiety, incompletion of work, any negative incident, ended a significant relationship","Practice relaxation techniques and also practice deep breathing while going to sleep. Do not think about anything keep your mind free from worries and tensions","1","2011-12-03 07:47:03");
INSERT INTO tblsleeps VALUES("8","I went to bed at a reasonable hour and woke up feeling rested and refreshed","Goes to bed late, gets up late, irregular sleep timings, carries office work home, gets irritated quickly, tends to have headaches, overburdens self, has difficulty in falling asleep, has disturbed sleep, wakes up feeling tired","Needs to practice deep breathing exercise, relaxation. Better not to overburden self with work,be more focused.Have proper sleep times i.e. at-least 7 to 8 hours of sleep daily.","Hurries at the last moment due to procrastination of work, carries worries and tension to bed, often snores, sleep talks, night mares, wakes up frequently at night, sometimes wakes up too early or late","Accept responsibility with the smile, be relaxed and learn to enjoy your routine work, plan a proper work schedule and implement it.","Very much balanced and relaxed, cool, systematic","Normal thus treatment not indicated","Goes to bed without any worries or tension, does not over burden self, is very systematic in approach, gets up refreshed, God fearing, honest in completing his work","Normal thus treatment not indicated","Prioritizes the work, utilizes the time fruitfully, always happy in life, like to take up challenges, has a relaxed peaceful sleep","Normal thus treatment not indicated","1","2011-11-30 05:48:12");
INSERT INTO tblsleeps VALUES("9","I Snore (does it disturb other)","Positive attitude, goes to sleep on time","Normal thus treatment not indicated","Relaxed, plans things","Normal thus treatment not indicated","Balanced, stable","Normal thus treatment not indicated","Tired, health problems, no proper sleep pattern, habituated","Need to practice deep breathing exercises & any of the relaxation technique. Go to bed at the right time without carrying any of the worries or tensions. Remember each problem has a solution thus there is no use overburdening self by having negative thoughts.","Fatigue, heavy workload, tension","Accept responsibility with the smile, enjoy your job in hand, try to excel, enjoy with you family,go for walk, jogging,swimming etc","1","2011-11-30 05:50:55");
INSERT INTO tblsleeps VALUES("10","I have excessive day time sleepiness","Completes work on time, does not over burden self","Normal thus treatment not indicated","Job satisfaction, enjoys work","Normal thus treatment not indicated","Relaxed, positive attitude","Normal thus treatment not indicated","Goes late to sleep, no proper sleeping pattern, does not get sleep at night, watches T,V, till late night, spends time in mobile/net -chatting, talking, playing","Sleeping at the right time having 7 to 8 hours of good sleep will make you refreshed. It is better to practice deep breathing. Enjoy the work in hand, plan the work schedule","Works extra hours or in shifts, travels a lot, sleep disturbances at night, over strains self","In case of shifts try balancing your self and adjusting to the work environment, do not over burden self","1","2011-11-30 05:53:13");
INSERT INTO tblsleeps VALUES("11","I have morning headaches","Controls negative thoughts, gets up fresh with good mood and enthusiasm","Normal thus treatment not indicated","Job satisfaction, follows proper sleep pattern","Normal thus treatment not indicated","Plans things, stable","Normal thus treatment not indicated","Health problem, no job satisfaction, lacks planning, procrastination, gets up too early or late","Practice deep breathing, exercises,relation techniques, try to replace negative thoughts with positive thoughts,practicing to re-leave symptoms.","Lack of sleep, disturbed sleep, persistant negative thoughts","Live in present, concentrate on what you actually have to do with regard to job, family etc and enjoying what you do, will help you. Practicing some physical exercises like jogging, swimming, walking","1","2011-12-03 06:31:35");
INSERT INTO tblsleeps VALUES("12","I work a nightshift or have to change work schedules a lot","Used to change in time schedule, prepared to work at any changing hours, focused more on job, dedicated, hardworking, peace of mind","Normal thus treatment not indicated","Job satisfaction, maintains healthy relation with the colleagues, conducive work environment","Normal thus treatment not indicated","Relaxed, stable, balanced, happy","Normal thus treatment not indicated","Headaches, acidity problems, no job satisfaction, stressful, fatigue, insomnia","Accept the job in hand, remember the fact that there are several people working as you do. Be happy with your job as it is the source of income to you and your family. Try searching a day schedule job if in need of it.But see that you perform honestly with the job in hand.","Restless, irritable, longing to get a good job, planning to quit the job in hand, tight schedules, no time to relax or rest","Accept responsibility, plan weekends with family and friends, do not keep on regretting as you will gain nothing from it. Develop healthy habits such as yoga, meditation etc","1","2011-12-03 06:32:05");
INSERT INTO tblsleeps VALUES("13","I travel abroad a lot (jet lag)","Likes to travel, takes up challenges, enjoys work, job satisfaction","Normal thus treatment not indicated","Learns a lot by travelling, awareness of many things due to travelling, shares ideas and feelings, likes to meet people, innovative","Normal thus treatment not indicated","Accepts responsibility with  smile, relaxed","Normal thus treatment not indicated","Feels tired easily, no time to relax or rest, tight schedule, does not like travelling too much","Develop a thirst towards knowledge automatically you will learn more and gain a lot from it. Enjoy your job many do not get such an opportunity. Have a healthy diet, eat good and nutritious food","Has lot of health problems, sleep disturbances,Zigarnik affect, Bio-rhythm is affected, does not like to travel but has to due to work demand","Enjoy the company of family members and friends sharing your joys and sorrows, go out on day offs. Try having 7 to 8hrs of sleep. Practice adjusting to your work schedule","1","2011-12-03 06:32:46");
INSERT INTO tblsleeps VALUES("14","I wake up often at night","Plans things, enjoys life, happy","Normal thus treatment not indicated","Healthy, follows proper sleep pattern","Normal thus treatment not indicated","Relaxed, gets sound sleep","Normal thus treatment not indicated","Incompletion of assigned task , anxiety","Enjoy your job and your responsibility, try to handle issues peacefully, practice some physical exercises like jogging, swimming, walking. Go to bed on time.","Health problems-dryness of mouth, frequent urination, interference of negative thoughts, financial problems","Try to have at-least 7 to 8 hours of sleep.Do not procrastinate in completing the daily task. Do not overburden yourself","1","2011-12-03 06:33:13");
INSERT INTO tblsleeps VALUES("16","I wake up suddenly from bed (how often)","Prays to god/Relaxes before going to bed, handles the problems tactfully","Normal thus treatment not indicated","Completes the assigned work, keeps body and mind relaxed","Normal thus treatment not indicated","Follows proper sleeping pattern, stable, tolerant","Normal thus treatment not indicated","Health issues, financial problems, problem in job/family","Pray to God daily, Have a health check-up. Remember that every problem has a solution. So relax only then you can find a solution to it.","Anxiety, fear, incomplete task, suffered short-term illness, injury, surgery","Practice deep breathing exercises, go for a walk or jogging. Enjoy yourself with family and friends. Do not overburden your self. Accept responsibilities with the smile.","1","2011-12-03 07:51:03");
