INSERT INTO tblworkandenvironments VALUES("1","I make an effort to work co-operatively, not competitively.","Not co-operative, not competitive, negative attitude towards the job","Have faith in god, accept the job in hand, practice deep breathing, relaxation, try to be a good listener, make note of things, plan work schedule","Lack of interest, unhappy, uncomfortable, lacks taking initiative","Do not take the office work home, spend time with family & friends during free time, practice yoga & meditation, accept the job in hand & enjoy it","Secured, job satisfaction, balanced, not  egoistic","Normal thus treatment not indicated","Co-operative, comfortable,  dedicated, alert.","Normal thus treatment not indicated","Values work, innovative, hardworking","Normal thus treatment not indicated","1","2011-11-19 09:20:21");
INSERT INTO tblworkandenvironments VALUES("3","I balance the challenges & stresses of my life with playful & nurturing attitudes & activities.","Fear of failure due to past experience, procrastinating, committing errors, lacks taking initiative","Accepting the job in hand,INSERT INTO tblworkandenvironments VALUES("5","I feel secured & satisfied in what I do.","Not co-operative, negative attitude towards job, lack of interest","Accept the job in hand, develop a positive approach towards it-change in thoughts leads to change in your approach, try to discuss with other if there are any queries, enjoy in the job in hand","Committing errors, uncomfortable, suffers from injustice","Cultivating hobbies and concentrating on it when you are having disturbed thoughts,do not make yourself overburdened, try to spend time with family and friends fruitfully","Secured, not egoistic, accepts responsibility with the smile","Normal thus treatment not indicated","Co-operative, understanding, good decision making ability","Normal thus treatment not indicated","Job satisfaction, not egoistic, comfortable","Normal thus treatment not indicated","1","2011-11-19 13:40:34");
INSERT INTO tblworkandenvironments VALUES("6","I feel valued & recognized at work and home.","Frequently blamed or intimated with warnings, fear of responsibility","Calm your mind by practicing yoga or meditation first,start accepting responsibility with the smile and you will enjoy it,learn from the past this will help you in minimizing errors","Uncomfortable, unhappy, fear of responsibility, feelings of insecurity","Accept your job & responsibility, have faith in your self & abilities, have control over your unnecessary expenditure,spend time with your family, practice deep breathing daily","Job satisfaction, accepts responsibility with the smile, balanced","Normal thus treatment not indicated","Understanding, secured,  dedicated","Normal thus treatment not indicated","Innovative, values work, hardworking","Normal thus treatment not indicated","1","2011-11-28 10:11:06");
INSERT INTO tblworkandenvironments VALUES("7","I get along well with the people I deal with","Not co-operative, not competitive, feelings of insecurity, negative attitude towards the job","Try to bring out a change in self rather than changing others, over look as to were you have gone wrong and try correcting it first, accept your job & develop positive attitude towards it","Hurrying at the last moment, unhappy, uncomfortable, egoistic","Relax first, practice relaxation training,complete the daily work on time thus you need not hurry, develop a positive attitude towards others, try considering others opinion also if it is for good","Balanced, job satisfaction, secured","Normal thus treatment not indicated","Not egoistic, accepts responsibility with the smile","Normal thus treatment not indicated","Understanding, happy, comfortable, dedicated","Normal thus treatment not indicated","1","2011-11-28 10:13:46");
INSERT INTO tblworkandenvironments VALUES("8","Personal related problem and thoughts disturb me at work or lose interest at work","Innovative, happy, dedicated, plans and works for the progress of the organization","Normal thus treatment not indicated","Co-operative, competitive,  understanding, comfortable","Normal thus treatment not indicated","Balanced, secured, job satisfaction, accepts responsibility with the smile","Normal thus treatment not indicated","Committing errors, unhappy, uncomfortable, worried","Keep your mind calm & relaxed, replace your negative thoughts with positive thoughts, complete your work on time, plan a schedule based on priority","Feelings of  insecurity, fear of failure due to past experience, lack of interest , negative attitude towards the job","Accept the job in hand, past is past there is no use worrying, so try changing your negative thoughts to positive, engage your self in some productive work, practice deep breathing","1","2011-11-28 10:15:22");
INSERT INTO tblworkandenvironments VALUES("9","Related issues of the company  makes me uncomfortable/unhappy at work","Plans and works for the progress of organization, dedicated, hardworking","Normal thus treatment not indicated","Happy, comfortable, competitive, innovative","Normal thus treatment not indicated","Balanced,  job satisfaction,  accepts responsibility with the smile","Normal thus treatment not indicated","Lack of interest, not co-operative, negative attitude towards the job, poor time management","Accept your job in hand, when at work concentrate only on it do not allow any other thoughts to disturb you, try planning your schedule according to priority, accept responsibility with a smile","Frequently blamed or intimated with warnings, feelings of insecurity, fear of failure due to past experience, demanding","Start practicing deep breathing & relaxation, try being more confident, start taking challenges,accept failure & try to overcome it.","1","2011-11-28 10:17:42");
