DROP TABLE IF EXISTS tblactivitymultiplier;

CREATE TABLE `tblactivitymultiplier` (
  `actmul_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `activity_level` varchar(100) NOT NULL DEFAULT '',
  `activity_level_code` varchar(10) NOT NULL DEFAULT '',
  `activity_level_multiplier` varchar(100) NOT NULL DEFAULT '',
  PRIMARY KEY (`actmul_id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tbladdictions;

CREATE TABLE `tbladdictions` (
  `adct_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `situation` text NOT NULL,
  `interpretaion_0_2` text NOT NULL,
  `treatment_0_2` text NOT NULL,
  `interpretaion_3_4` text NOT NULL,
  `treatment_3_4` text NOT NULL,
  `interpretaion_5_6` text NOT NULL,
  `treatment_5_6` text NOT NULL,
  `interpretaion_7_8` text NOT NULL,
  `treatment_7_8` text NOT NULL,
  `interpretaion_9_10` text NOT NULL,
  `treatment_9_10` text NOT NULL,
  `status` int(1) NOT NULL DEFAULT '0',
  `adct_add_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`adct_id`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tbladmin;

CREATE TABLE `tbladmin` (
  `admin_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(100) NOT NULL DEFAULT '',
  `password` varchar(50) NOT NULL DEFAULT '',
  `email` varchar(200) NOT NULL DEFAULT '',
  `fname` varchar(100) NOT NULL DEFAULT '',
  `lname` varchar(100) NOT NULL DEFAULT '',
  `dob` date NOT NULL DEFAULT '0000-00-00',
  `contact_no` varchar(15) NOT NULL DEFAULT '',
  `address` text NOT NULL,
  `city` varchar(100) NOT NULL DEFAULT '',
  `state` varchar(100) NOT NULL DEFAULT '',
  `country` varchar(100) NOT NULL DEFAULT '',
  `super_admin` int(1) NOT NULL DEFAULT '0',
  `admin_menu_id` varchar(200) NOT NULL DEFAULT '',
  `admin_action_id` text NOT NULL,
  `status` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`admin_id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tbladminactions;

CREATE TABLE `tbladminactions` (
  `admin_action_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `admin_menu_id` bigint(11) NOT NULL DEFAULT '0',
  `action_name` varchar(100) NOT NULL DEFAULT '',
  `action_add_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`admin_action_id`)
) ENGINE=MyISAM AUTO_INCREMENT=158 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tbladminmenu;

CREATE TABLE `tbladminmenu` (
  `menu_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `menu_name` varchar(100) NOT NULL DEFAULT '',
  `menu_mode` varchar(100) NOT NULL DEFAULT '',
  `status` int(1) NOT NULL DEFAULT '0',
  `manu_add_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`menu_id`)
) ENGINE=MyISAM AUTO_INCREMENT=39 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tblangervent;

CREATE TABLE `tblangervent` (
  `anger_vent_box_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `step` int(1) NOT NULL DEFAULT '0',
  `box_title` varchar(100) NOT NULL DEFAULT '',
  `box_type` enum('Image','Video','Flash','Audio') NOT NULL DEFAULT 'Image',
  `box_banner` varchar(200) NOT NULL DEFAULT '',
  `box_desc` varchar(200) NOT NULL DEFAULT '',
  `credit_line` varchar(100) NOT NULL DEFAULT '',
  `credit_line_url` varchar(200) NOT NULL DEFAULT '',
  `status` int(1) NOT NULL DEFAULT '0',
  `user_add_banner` int(1) NOT NULL DEFAULT '0',
  `user_id` bigint(11) NOT NULL DEFAULT '0',
  `day` varchar(100) NOT NULL DEFAULT '',
  `sound_clip_id` bigint(11) NOT NULL DEFAULT '0',
  `box_add_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`anger_vent_box_id`)
) ENGINE=MyISAM AUTO_INCREMENT=164 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tblangerventmusic;

CREATE TABLE `tblangerventmusic` (
  `anger_vent_music_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `step` int(1) NOT NULL DEFAULT '0',
  `music` varchar(100) NOT NULL DEFAULT '',
  `day` varchar(200) NOT NULL DEFAULT '',
  `credit` varchar(100) NOT NULL DEFAULT '',
  `credit_url` varchar(100) NOT NULL DEFAULT '',
  `status` int(1) NOT NULL DEFAULT '0',
  `music_add_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`anger_vent_music_id`)
) ENGINE=MyISAM AUTO_INCREMENT=32 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tblangerventpdf;

CREATE TABLE `tblangerventpdf` (
  `anger_vent_pdf_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `step` int(1) NOT NULL DEFAULT '0',
  `pdf` varchar(100) NOT NULL DEFAULT '',
  `pdf_title` varchar(200) NOT NULL DEFAULT '',
  `day` varchar(100) NOT NULL DEFAULT '',
  `credit` varchar(100) NOT NULL DEFAULT '',
  `credit_url` varchar(200) NOT NULL DEFAULT '',
  `status` int(1) NOT NULL DEFAULT '0',
  `user_uploads` int(1) NOT NULL DEFAULT '0',
  `user_id` bigint(11) NOT NULL DEFAULT '0',
  `anger_vent_pdf_add_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`anger_vent_pdf_id`)
) ENGINE=MyISAM AUTO_INCREMENT=23 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tblangerventtooltip;

CREATE TABLE `tblangerventtooltip` (
