\n<p style=\\\"text-align: center;\\\">Eustress has its own advantages but distress leads to hampered productivity. It is thus imperative to nip it in the bud.</p>\n<p style=\\\"text-align: center;\\\">In this section of your tracker, through your regular ratings you are given the opportunity to understand the situations and thoughts that stress you up the most and helps you get behind the root cause and also guides you on how you can positively deal with it.</p>\n<p style=\\\"text-align: center;\\\">&nbsp;</p>\n<p style=\\\"text-align: center;\\\"><strong><span style=\\\"font-family: verdana, geneva; color: #993366;\\\">Go ahead and select the relevant situations faced today with your related response scale &amp; details (optional) !!!</span></strong></p>\n<div><strong><span style=\\\"font-family: verdana, geneva; color: #993366;\\\"><br /></span></strong></div>\n<p>&nbsp;</p>\n<p style=\\\"text-align: center;\\\">&nbsp;</p>","Chaitanya Wellness Research Institute - General Stressors","Chaitanya Wellness Research Institute, wellnessway4u, Stress Management, general stressors, stress causes, stress response, manage situations, mental, emotional life, pleasure, relationship,","Chaitanya Wellness Research Institute, wellnessway4u, Preventive Healthcare, Personalised Health & Wellness Management, Emotional & Stress Management, Holistic Health, Rejuvenation, Provide Support Tools to complement the expertise of Health & Wellness Practitioners, tracking and Self Awareness Tool for Stress,","1","1","2011-12-05 04:54:02","1","1","1","45","5","General Stressors","general_stressors.php");
