\n<p style=\\\"text-align: right;\\\"><span style=\\\"text-align: center; font-family: verdana, geneva; font-size: small;\\\"><span style=\\\"font-size: medium;\\\"><a class=\\\"body_link\\\" style=\\\"text-align: center;\\\" href=\\\"login.php\\\"><strong>Your DIARY</strong></a></span></span></p>\n<p><span style=\\\"font-family: Verdana; font-size: small; line-height: 115%;\\\">Wellness is an organised set of Activities to help Individuals make changes or maintain habits that&nbsp;</span><span style=\\\"background-color: #ffff00;\\\">help reduce their health Risks as well as enhance their capabilities.</span></p>\n<p><span style=\\\"font-family: Verdana; line-height: 115%;\\\">Today we have preventive healthcare programs, excellent wellness &amp; health products and services but for some reason we are&nbsp;</span><strong style=\\\"font-family: Verdana; font-size: 10pt; line-height: 115%;\\\">not</strong><span style=\\\"font-family: Verdana; line-height: 115%;\\\">&nbsp;able to benefit the most out of them as</span><span style=\\\"line-height: 14.949999809265137px; font-size: small; font-family: verdana, geneva;\\\">&nbsp;-</span></p>\n<ol>\n<li><span style=\\\"line-height: 14.949999809265137px; font-size: small; font-family: verdana, geneva;\\\">Wellness is more than Diet, Weight &amp; Exercises &amp; must include the critical Emotional Parameters of our Daily Routine.</span><span style=\\\"line-height: 14.949999809265137px; font-family: verdana, geneva;\\\">&nbsp;</span></li>\n<li><span style=\\\"font-family: verdana, geneva; font-size: small;\\\">Wellness to be effective <span style=\\\"background-color: #ffff00;\\\">has to be a continuous process</span> which is possible only through quality motivation.&nbsp;</span><span style=\\\"font-family: verdana, geneva; line-height: 14.949999809265137px;\\\">&nbsp;</span></li>\n</ol>\n<p><span style=\\\"line-height: 14.949999809265137px; font-size: small; font-family: verdana, geneva;\\\">Therefore&nbsp;</span><spa