DROP TABLE IF EXISTS tblparentsliders;

CREATE TABLE `tblparentsliders` (
  `parents_slider_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `slider_name` varchar(50) NOT NULL DEFAULT '',
  `parent_slider_add_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`parents_slider_id`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tblplaces;

CREATE TABLE `tblplaces` (
  `place_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `state_id` bigint(11) NOT NULL DEFAULT '0',
  `city_id` bigint(11) NOT NULL DEFAULT '0',
  `place` varchar(200) NOT NULL DEFAULT '',
  `pincode` varchar(20) NOT NULL DEFAULT '',
  `place_add_date` double(20,0) NOT NULL DEFAULT '0',
  PRIMARY KEY (`place_id`)
) ENGINE=MyISAM AUTO_INCREMENT=21993 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS tblposition;

CREATE TABLE `tblposition` (
  `position_id` bigint(11) NOT NULL AUTO_INCREMENT,
  `position` varchar(100) NOT NULL DEFAULT '',
  `side` varchar(50) NOT NULL DEFAULT '',
  `width` varchar(50) NOT NULL DEFAULT '',
  `height` varchar(50) NOT NULL DEFAULT '',
  `google_ads` text NOT NULL,
  `position_add_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`position_id`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;

